import React from "react";

const Spaces=()=>{
    const [spaces, setSpaces] = React.useState([]);

    React.useEffect(() => {
      fetch("/getspaces")
        .then((res) => res.json())
        .then((data) => setSpaces(data.spaces));
    }, []);
    console.log(spaces);
    return(
        <div>
           {
               spaces.map(space=>{
                   <div key={space._id} style={{color:"black"}}>
                       <img src={space.image}/>
                        {space.name}
                        {space.content}
                     
                   </div>
               })
           } 
        </div>
    )
   
}
export default Spaces;
